// import classes from '*.module.css';

const useStyles = makeStyles(()=> ({
    typographyStyles : {
        flex: 1
    }
}))
const Navbar = () => {
    return (
        <AppBar position="static">
            <Toolbar>
                <Typography className = {classes.typographyStyles}>Alton Ong</Typography>
                <AccountBoxIcon/>
            </Toolbar>
        </AppBar>
    )
};

export default Navbar;
